class AdditiveViterbiTest {

    @Test
    public void stringSerializationTest() {
        /*
        This test shows a bug I am unable to figure out:
         - read TreeAutomaton from a string
         - run viterbi on it
         - serialize TA to string
         - read TreeAutomaton from that string (should be identical to the first TA)
         - run viterbi, get different result
         
         ???

         In this case, the second output is the correct one (verified by hand).
         All rules have a constant penalty and the shortest tree is the best in this TA.
         */
        TreeAutomaton ta;
        ta = new TreeAutomatonInputCodec().read(new ByteArrayInputStream(taStr.getBytes()));
        Tree<String> firstTree = ta.viterbi(AdditiveViterbiSemiring.INSTANCE);
        print("\nfirst:\n")
        print(firstTree)
        ta = new TreeAutomatonInputCodec().read(new ByteArrayInputStream(ta.toString().getBytes()));
        Tree<String> secondTree = ta.viterbi(AdditiveViterbiSemiring.INSTANCE);
        print("\nsecond:\n")
        print(secondTree)
        // assertEquals(firstTree.toString(), secondTree.toString())
        
        // just do it several times for fun and see that it also does not converge to the correct output
        String currTaStr = taStr
        for (int i=0; i<20; i++) {
            ta = new TreeAutomatonInputCodec().read(new ByteArrayInputStream(currTaStr.getBytes()));
            print("\n" + ta.viterbi(AdditiveViterbiSemiring.INSTANCE).toString())
            currTaStr = ta.toString()
        }
    }

